import React, { useState } from 'react'

const data = {text:'Total earning',
    num:'$13,690',
    percent:'36%',    
}

const Ecard = (data) => {
  return (
    <div class='flex'>
        <img></img>
        <div>
            <p>{data.text}</p>
            <p>{data.num}</p>
        </div>
    </div>
  )
}

export default Ecard
